  memset(&p[0], 0, sizeof(double) << 16);
  for (i = 0; i < 197; i++) {
    for (iy = 0; iy < 256; iy++) {
      s[iy] = b_xx[i + 197 * iy] * dv0[iy];
    }

    ix = 0;
    ju = 0;
    iy = 0;
    for (b_i = 0; b_i < 255; b_i++) {
      y[iy].re = s[ix];
      y[iy].im = 0.0;
      j = 256;
      tst = true;
      while (tst) {
        j >>= 1;
        ju ^= j;
        tst = ((ju & j) == 0);
      }

      iy = ju;
      ix++;
    }

    y[iy].re = s[ix];
    y[iy].im = 0.0;
    for (b_i = 0; b_i <= 255; b_i += 2) {
      temp_re = y[b_i + 1].re;
      temp_im = y[b_i + 1].im;
      y[b_i + 1].re = y[b_i].re - y[b_i + 1].re;
      y[b_i + 1].im = y[b_i].im - y[b_i + 1].im;
      y[b_i].re += temp_re;
      y[b_i].im += temp_im;
    }

    iy = 2;
    ix = 4;
    k = 64;
    ju = 253;
    while (k > 0) {
      for (b_i = 0; b_i < ju; b_i += ix) {
        temp_re = y[b_i + iy].re;
        temp_im = y[b_i + iy].im;
        y[b_i + iy].re = y[b_i].re - temp_re;
        y[b_i + iy].im = y[b_i].im - temp_im;
        y[b_i].re += temp_re;
        y[b_i].im += temp_im;
      }

      istart = 1;
      for (j = k; j < 128; j += k) {
        twid_re = dv3[j];
        twid_im = dv4[j];
        b_i = istart;
        ihi = istart + ju;
        while (b_i < ihi) {
          temp_re = twid_re * y[b_i + iy].re - twid_im * y[b_i + iy].im;
          temp_im = twid_re * y[b_i + iy].im + twid_im * y[b_i + iy].re;
          y[b_i + iy].re = y[b_i].re - temp_re;
          y[b_i + iy].im = y[b_i].im - temp_im;
          y[b_i].re += temp_re;
          y[b_i].im += temp_im;
          b_i += ix;
        }

        istart++;
      }

      k /= 2;
      iy = ix;
      ix += ix;
      ju -= iy;
    }

    for (k = 0; k < 256; k++) {
      temp_re = rt_hypotd_snf(y[k].re, y[k].im);
      p[i + (k << 8)] = temp_re * temp_re;
    }
  }

  for (i = 0; i < 256; i++) {
    j = i << 8;
    s[i] = p[j];
    for (k = 0; k < 255; k++) {
      s[i] += p[(j + k) + 1];
    }
  }

  for (iy = 0; iy < 24; iy++) {
    dv1[iy] = 0.0;
    for (j = 0; j < 129; j++) {
      dv1[iy] += bank[iy + 24 * j] * s[j];
    }
  }

  b_log(dv1);

  /* A=size(ccc);   */
  for (iy = 0; iy < 12; iy++) {
    c1[iy] = 0.0;
    for (j = 0; j < 24; j++) {
      c1[iy] += a[iy + 12 * j] * dv1[j];
    }

    c[iy] = c1[iy];
    c[iy + 12] = c1[iy] * dv2[iy];
  }
